import { ApiCallBack } from './FetchApi'
import * as apis from './Constants'

export const EmployeeRegiterApi = async (data) => {
    console.log(apis.url + apis.EmployeeRegit)
    return await ApiCallBack(apis.url, apis.EmployeeRegit,data)
}
